import React, { useEffect } from 'react';
import Header from './components/Header';
import Projects from './components/Projects';
import Skills from './components/Skills';
import About from './components/About';

import './styles/main.css';

function Home() {
  return (
    <section id="home" className="container card">
      <div className="hero-card">
        <div className="hero-left">
          <span style={{ color: "#f87171", fontWeight: 600, fontSize: "0.95rem" }}>
            GET EVERY SINGLE SOLUTION.
          </span>
          <h1>
            I’m <span style={{ color: "#2563eb" }}>Priyadharshini</span><br />
            Full Stack Developer & UI/UX Designer
          </h1>
          <p className="lead">
            Passionate about building modern web and mobile applications.<br />
            I love transforming ideas into beautiful, user-friendly products.
          </p>
          <div className="hero-cta">
            <a href="#projects" className="btn">View Projects</a>
            <a href="#contact" className="btn-outline">Contact Me</a>
          </div>
        </div>
        <div className="hero-right">
          <div className="avatar">P</div>
          <ul className="hero-meta">
            <li>Full Stack MERN Developer</li>
            <li>React & React Native Specialist</li>
            <li>UI/UX Enthusiast</li>
          </ul>
        </div>
      </div>
    </section>
  );
}

function App() {
  useEffect(() => {
    const sections = Array.from(document.querySelectorAll('section'));
    const observer = new IntersectionObserver(
      (entries, obs) => {
        entries.forEach((entry) => {
          if (entry.isIntersecting) {
            const el = entry.target;
            el.classList.add('in-view');
            obs.unobserve(el);
          }
        });
      },
      { threshold: 0.15 }
    );

    sections.forEach((sec, idx) => {
      sec.classList.add('reveal');
      sec.style.transitionDelay = `${idx * 120}ms`;
      observer.observe(sec);

      const rect = sec.getBoundingClientRect();
      if (rect.top <= window.innerHeight * 0.85) {
        sec.classList.add('in-view');
        observer.unobserve(sec);
      }
    });

    return () => observer.disconnect();
  }, []);

  return (
    <div className="App">
      {/* Navigation bar */}
      <div className="navbar">
        <div className="navbar-inner">
          <div className="navbar-logo">PORTFOLIO</div>

        </div>
      </div>

      <Header />
      <main>
        <Home />
        <section id="about" className="container card">
          <About />
        </section>
        <section id="skills"><Skills /></section>
        <section id="projects"><Projects /></section>
        <section id="contact"></section>
      </main>
      <footer className="footer">
        <div className="container">© {new Date().getFullYear()} Priyadharshini — Full‑Stack MERN & UX/UI Designer</div>
      </footer>
    </div>
  );
}

export default App;
